# -*- coding: utf-8 -*-
class Solution(object):
    def findLadders(self, beginWord, endWord, wordList):
        """
        Solution: Single direction BFS (TLE)
        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: List[List[str]]
        """
        wordList = set(wordList)
        if endWord not in wordList: return []
        res = []
        beginSet = [[beginWord]]
        while beginSet:
            next_level_set = list()
            advanced_to_next = True
            for k in beginSet:
                for i in range(len(k[-1])):
                    current_list = list(k[-1])
                    for j in range(ord('a'), ord('z')+1):
                        path = k[:]
                        current_list[i] = chr(j)
                        check = ''.join(current_list)
                        if check == endWord:
                            path.append(check)
                            res.append(path)
                            advanced_to_next = False
                            break
                        else:
                            if check != k[-1] and check not in set(path) and check in wordList:
                                path.append(check)
                                next_level_set.append(path)
                if not advanced_to_next:
                    beginSet = []
                else:
                    beginSet = next_level_set
        return res

